// Navbar Component 
function Navbar() {
    return (
        <nav>
            <h1>Perfumy</h1>
            <ul>
                <li>Home</li>
                <li>Products</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </nav>
    )
}

export default navbar
